import React, {useState} from 'react';
import Axios from "axios"


const App = () => {
    const [UserNameReg, SetUserNameReg] = useState('');
    const [UserPasswordReg, SetUserPasswordReg] = useState('');
    const log = () => {
        Axios.post("http://localhost:3001/login", {
            username: UserNameReg,
            password: UserPasswordReg
        }).then(response => {
            console.log(response)

        })
    }
    return (
        <div>
            <input className="form__input" type="text" id="username" placeholder="First Name" onChange={(e) => {
                SetUserNameReg(e.target.value)
            }}/>
            <input className="form__input" type="password" id="password" placeholder="Password" onChange={(e) => {
                SetUserPasswordReg(e.target.value)
            }}/>
            <button type="submit" className="btn" onClick={log()}>Login</button>

        </div>


    );
};

export default App;
